import { NgModule, APP_INITIALIZER  } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { AppComponent } from './app.component';
import { TestComponent } from './test/test.component';
import { captureScreenshots, generatePDF } from 'ng-serve-capture-screenshots';

@NgModule({
    declarations: [
        AppComponent,
        TestComponent
    ],
    imports: [
        BrowserModule
    ],
    providers: [
        {
          provide: APP_INITIALIZER,
          useFactory: initializeCaptureScreenshots,
          multi: true,
          deps: [],
        },
        {
          provide: APP_INITIALIZER,
          useFactory: initializeGeneratePDF,
          multi: true,
          deps: [],
        }
      ],
    bootstrap: [AppComponent]
})
export class AppModule {
}

export function initializeCaptureScreenshots() {
    return () => {
      const urls = ['http://localhost:4200'];
      captureScreenshots(urls).then((screenshots) => {
        // Do something with the screenshots (optional)
      });
    };
  }

  export function initializeGeneratePDF() {
    return () => {
      const screenshots: Buffer[] = []; // Assuming you have captured screenshots during server run
      generatePDF(screenshots, 'output.pdf');
    };
  }
